import React from "react";
import "./Work.css";

function Work() {
    return (
        <div className="work-container">
        <h2>My WorkStation</h2>
        <div className="work-item">
            <h3>Project Title</h3>
            <p>Description of the project goes here. It should be concise and highlight the key features and technologies used.</p>
        </div>
        <div className="work-item">
            <h3>Another Project Title</h3>
            <p>Description of another project. Focus on what makes it unique or interesting.</p>
        </div>
        {/* Add more work items as needed */}
        </div>
    );
    }

    export default Work;
